!async function(){Page.Load.get_desmos_data=()=>{let e={"direction-field":{bounds:{left:-5,right:5,bottom:-5,top:5},expressions:[{latex:String.raw`f(t, y) = \frac{\sin(y)}{t^2 + 1}`},{latex:String.raw`y(t) = 2\arccot(e^{c - \arctan(t)})`,color:DESMOS_BLUE},{latex:String.raw`c = 0`,sliderBounds:{min:-5,max:5}},{latex:String.raw`n = 10`,sliderBounds:{min:1,max:20,step:1}},{latex:String.raw`I = [0, 1, ..., (2n + 1)^2 - 1]`,secret:!0},{latex:String.raw`A = [-n, -n + 1, ..., n]`,secret:!0},{latex:String.raw`X = A[\mod(I, 2n + 1) + 1]`,secret:!0},{latex:String.raw`Y = X[\floor(I / (2n + 1)) + 1]`,secret:!0},{latex:String.raw`f(X, Y)(x - X) + Y \{\left|x - X\right| \leq \frac{.3}{\sqrt{1 + f(X, Y)^2}}\}`,color:DESMOS_PURPLE,secret:!0},]},"direction-field-2":{bounds:{left:-10,right:10,bottom:-10,top:10},expressions:[{latex:String.raw`f(t, y) = \frac{1}{50}(y^2 - 4)\left|y - 4\right|(t - 3)`},{latex:String.raw`n = 10`,sliderBounds:{min:1,max:20,step:1}},{latex:String.raw`I = [0, 1, ..., (2n + 1)^2 - 1]`,secret:!0},{latex:String.raw`A = [-n, -n + 1, ..., n]`,secret:!0},{latex:String.raw`X = A[\mod(I, 2n + 1) + 1]`,secret:!0},{latex:String.raw`Y = X[\floor(I / (2n + 1)) + 1]`,secret:!0},{latex:String.raw`f(X, Y)(x - X) + Y \{\left|x - X\right| \leq \frac{.3}{\sqrt{1 + f(X, Y)^2}}\}`,color:DESMOS_PURPLE,secret:!0},]}};return e},Page.Load.create_desmos_graphs(),Page.show(),await Site.load_applet("vector-fields");let e=Page.element.querySelector("#vector-field-canvas"),t=new VectorField(e);t.load_promise.then(()=>{t.run("(1.0, sin(y) / (x*x + 1.0))",500,1e4,.0075,100,0,0,1.3219),t.pause()}),Site.pause_applet_when_offscreen(t)}();